<template>
  <section class="hero is-warning is-fullheight">
    <div class="hero-body">
      <div class="container">
        <div class="columns is-centered">
          <div class="column is-5-tablet is-4-desktop is-4-widescreen">
            <form class="box">

              <div class="field has-text-centered">
                <img src="../assets/valetparking.png" width="240">
              </div>

              <div class="field">
                <label class="label">Nama</label>
                <div class="control has-icons-left has-icons-right">
                  <input class="input" type="text" placeholder="Nama Pemilik Kendaraan" v-model="nama" required>
                  <span class="icon is-small is-left">
                    <i class="fas fa-user"></i>
                  </span>
                </div>
              </div>

              <div class="field">
                <label class="label">Merk Kendaraan</label>
                <div class="control has-icons-left has-icons-right">
                  <input class="input" type="text" placeholder="Merk / Tipe Kendaraan" v-model="merk" required>
                  <span class="icon is-small is-left">
                    <i class="fas fa-car"></i>
                  </span>
                </div>
              </div>

              <div class="field">
                <label class="label">Plat Nomor</label>
                <div class="control has-icons-left has-icons-right">
                  <input class="input" type="text" placeholder="Plat Nomor" v-model="plat" required>
                  <span class="icon is-small is-left">
                    <i class="fas fa-car"></i>
                  </span>
                </div>
              </div>

              <div class="field">
                <label class="label">Warna</label>
                <div class="control has-icons-left has-icons-right">
                  <input class="input" type="text" placeholder="Warna Kendaraan" v-model="warna" required>
                  <span class="icon is-small is-left">
                    <i class="fas fa-car"></i>
                  </span>
                </div>
              </div>

              <div class="field">
                <div class="control">
                  <label class="checkbox">
                    <input type="checkbox" v-model="setuju">&nbsp;
                    <small class="setuju">Saya setuju dengan syarat dan ketentuan yang berlaku.</small>
                  </label>
                </div>
              </div>

              <div class="notification is-danger" v-if="peringatan">
                <button class="delete" @click="clearWarning()"></button>
                {{ pesan }}
              </div>

              <div class="columns is-mobile">
                <div class="column is-half-mobile">
                  <button class="button is-link is-fullwidth" @click="getPDF()">
                    <i class="fas fa-download"></i> &nbsp;&nbsp;Tiket
                  </button>
                </div>
                <div class="column is-half-mobile">
                  <button class="button is-success is-fullwidth" @click="ulangi()">
                    <i class="fas fa-undo-alt"></i> &nbsp;&nbsp;Ulangi
                  </button>
                </div>
              </div>

            </form>

            <div class="jhproject">
              <span>
                <a href="http://www.jhproject.id" target="_blank">&copy; 2018 JH Project</a>
              </span>
            </div>

          </div>
        </div>
      </div>
    </div>
  </section>
</template>

<script>
import jsPDF from 'jspdf';

export default {
  name: "home",
  data() {
    return {
      nama: null,
      merk: null,
      plat: null,
      warna: null,
      setuju: false,
      peringatan: false,
      pesan: null
    }
  },
  methods: {
    getPDF () {
      if (this.setuju) {
        const doc = new jsPDF({
          orientation: 'portrait',
          unit: 'cm',
          format: [6.8, 12]
        })
        
        let imgData = 'data:image/png;base64,'
        doc.addImage(imgData, 'JPEG', 0, 0, 6.8, 12);

        let nama = this.nama;
        let merk = this.merk;
        let plat = this.plat;
        let warna = this.warna;

        doc.setFontSize(10);
        doc.setTextColor(92, 76, 76);

        doc.text(1.85, 9.3, nama);
        doc.text(3.6, 9.95, merk);
        doc.text(2.8, 10.58, plat);
        doc.text(2.07, 11.2, warna);

        doc.save('TiketValet.pdf');
      } else {
        this.peringatan = true;
        this.pesan = 'Klik setuju terlebih dahulu.'
        setTimeout(() => {
          this.peringatan = false
        }, 5000)
      }
    },
    clearWarning() {
        this.peringatan = false;
        this.pesan = null
    },
    ulangi() {
      this.nama = null;
      this.merk = null;
      this.plat = null;
      this.warna = null;
      this.setuju = false;
      this.peringatan = false;
      this.pesan = null
    }
  }
};
</script>

<style>
.setuju {
  font-size: 0.7em;
}

.jhproject {
  text-align: center;
  font-size: 0.9em;
}

.jhproject span:hover {
  color: #fff;
}
</style>